import useState from "react";
import { ReactComponent as Logo } from "../Assets/imme icon-02.svg";

const Login = () => {
  const [formState, setFormState] = useState({
    first_name: "",
    last_name: "",
    document_type: "",
    document_number: "",
    document_country: "",
  });

  return(
    <>
      <form>
        <h3>Sign In</h3>

        <div className="mb-3">
          <label>First Name</label>
          <input
            type="text"
            className="form-control"
            placeholder="Enter first name"
            value={this.state.first_name}
            onChange={this.handleChange}
            name="first_name"
          />
        </div>

        {/* <div className="mb-3">
          <label>Last Name</label>
          <input
            type="text"
            className="form-control"
            placeholder="Enter last name"
            value={this.state.last_name}
            onChange={this.handleChange}
            name="last_name"
          />
        </div>

        <div className="mb-3">
          <label>Document type</label>
          <select
            className="form-select"
            placeholder="Select document type"
            onChange={this.handleChange}
            name="document_type"
          >
            <option defaultValue="">Select document type</option>
            <option value="driver_license">Driver License</option>
          </select>
        </div>

        <div className="mb-3">
          <label>Number</label>
          <input
            type="text"
            className="form-control"
            placeholder="Driver license number"
            value={this.state.document_number}
            onChange={this.handleChange}
            name="document_number"
          />
        </div> */}

        {/* <div className="mb-3">
          <label>Document country origin</label>
          <select
            className="form-select"
            placeholder="Select country"
            onChange={this.handleChange}
            name="document_country"
          >
            <option defaultValue="">Select here</option>
            <option value="can">Canada</option>
            <option value="fra">France</option>
          </select>
        </div> */}

        <div className="d-grid">
          <button type="submit" className="btn btn-primary">
            Submit
          </button>
        </div>
        <p className="forgot-password text-right">
          Forgot <a href="#">password?</a>
        </p>
        <hr className="my-4" />
        <div className="d-grid">
          <button
            className="btn btn-primary"
            style={{ backgroundColor: "orange", borderColor: "orange" }}
            onClick={this.props.signIn}
          >
            {" "}
            <Logo style={{ width: "20px", marginRight: "20px" }} />
            Sign In With Imme
          </button>
          <button
            className="btn btn-primary"
            style={{
              backgroundColor: "purple",
              borderColor: "purple",
              marginTop: "20px",
            }}
            // onClick={this.handleSubmit}
            onClick={this.props.verify}
          >
            {" "}
            <Logo style={{ width: "20px", marginRight: "20px" }} />
            Verify With Imme
          </button>
        </div>
      </form>
    </>
  );
}

export default Login;

